def run(data):
    d = {}
    for i in "abcdefghijklmnopqrstuvwxyz":
        d[i.lower()] = i.upper()
        d[i.upper()] = i.lower()
    ans = set()
    for j in "abcdefghijklmnopqrstuvwxyz":
        s2 = [i for i in data if i!= j.lower() and i != j.upper()]
        stack = []
        for k in s2:
            if stack and k == d[stack[-1]]:
                stack.pop()
            else:
                stack.append(k)
        ans.add(len(stack))
    print(min(ans))





